import React, { Component } from 'react';
import {
   Button,
   Card,
   Classes,
   Elevation,
   H5,
   Icon,
   Label,
   Slider,
   Switch
} from '@blueprintjs/core';

export default class BluePrintView extends Component {
   render() {
      return (
         <div>
            <Card interactive={true} elevation={Elevation.THREE}>
               <H5>Analytical applications</H5>
               <p>
                  User interfaces that enable people to interact smoothly with
                  data, ask better questions, and make better decisions.
               </p>
               <Button>
                  <Icon icon='document'></Icon> Upload...
               </Button>
            </Card>
         </div>
      );
   }
}
